f = open('codon.txt')

cod = {}
temp = ''

s = ''
res = ''

for i in f:
    line = i.split()
    for j in xrange(len(line)):
        #print j
        if len(line[j]) == 3:
            temp = line[j]
        else:
            cod[temp] = line[j]

#print cod

f.close()

start = 0

for i in xrange(0, len(s), 3):
    if s[i] == 'A' and s[i+1] == 'U' and s[i+2] == 'G' and start == 0:
        start = 1
        for j in xrange(i, len(s)-i, 3):
            #print s[j]+s[j+1]+s[j+2]
            if cod[s[j]+s[j+1]+s[j+2]] != 'Stop':
                res += cod[s[j]+s[j+1]+s[j+2]]
            else:
                #some probloems here
                break

